import { SuspenseGet } from 'utils/api';

export const fetchSalaryData = ({
	userId,
	dutyCategoryId,
	jobCategoryId,
	jwt,
}) =>
	SuspenseGet({
		url: `web/salary/50?jobCategoryId=${jobCategoryId}&dutyCategoryId=${dutyCategoryId}`,
		headers: {
			'x-access-token':
				'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJ1c2VySWQiOjUwLCJpYXQiOjE2NTg4NTg1MzgsImV4cCI6MTY5MDM5NDUzOCwic3ViIjoidXNlckluZm8ifQ.LCI_B2Y0gKo6JTpfbjNvfvPFu8Zk8cc_YQ3a2TER9Oo',
		},
	});
